    `,getEffects:({level:e=1})=>[{type:bt.dmgTrackAdj,track:Xe.charStun,value:e*-1}]},{id:"quality.CRB.gremlins",name:"Gremlins",bonus:6,source:{book:"CRB",page:76},gameEffect:`
